import { useEffect } from "react";
import { Container } from "reactstrap"

const About=()=>{
    useEffect(()=>{
        document.title="about page || with ps";
    },[])
    return(
        <>
        <Container>
            <h1>welcome to technical tutorials</h1>
            <p>We are providing good knowledge of java, python,react etc. 
                this organization started by satyampinky for trained for those student which one unable to buy
                course of techanical subject
            </p>
        </Container>
        </>
    );
}

export default About;
